import styled from 'styled-components';
export const Container = styled.div`
    .post-section{
        width: 90%;
        height: auto;
        display: grid;
        grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
        grid-gap: 20px;
    }
`;
